import { Link } from "react-router-dom";

function NavBar() {
    return(
        <div>
            <nav>
                <Link to="/">HomePage</Link>
                <p></p>
                <Link to="/About">AboutPage</Link>
            </nav>
        </div>
    );
}

export default NavBar;
